select(2, ...).LoadData("APP_INFO","Global",[[return {version=404,lastSync=1600705709,message={id=0,msg=""},news={{title="TradeSkillMaster v4.10.6 Changelog",content="TSM v4.10.6 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Added apperance option to show total gold instead of player gold at the top of TSM windows<br />* Fixed some disenchanting ratios<br />* Fixed issue with Bank UI not updating the group tree when switching tabs<br />* [Retail] Fixed issues when the reagent bank hasn't been purchased<br />* [Classic] Fixed issue with Vendoring buying not buying the correct amount<br />* [Classic] Fixed issue with Sniper not finding auctions under 1c per item<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1600645901,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-6-changelog/"},{title="TradeSkillMaster v4.10.5 Changelog",content="TSM v4.10.5 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed error when importing groups with operations<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1600103433,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-5-changelog/"},{title="TradeSkillMaster v4.10.4 Changelog",content="TSM v4.10.4 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Tweaked the selection state of the Base Group to be easier to see<br />* Fixed crash caused by circular relationships between operation settings<br />* Fixed issue with the Vendor UI not buying the correct amount<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1600037767,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-4-changelog/"},{title="TSM 4.10 Launch & Team Q&A",content="TSM 4.10 launched as announced this past Sunday, which is a huge milestone for the TSM Team! We're so glad that feedback has been overwhelmingly positive, and thankfully after a stable beta the release was stable too! If you haven't already, you can check out the full Change Log here. As part of the launch, [...]",timestamp=1599581570,link="https://blog.tradeskillmaster.com/tsm-4-10-launch-team-qa/"},{title="TradeSkillMaster v4.10.3 Changelog",content="TSM v4.10.3 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may ta